import { Button } from "react-bootstrap";

function Mester() {

  const szamol = (e) => {
    e.preventDefault();
    const a=e.target.A.value;
    const b=e.target.B.value;
    const n=e.target.N.value;
    
    console.log("Eredmeny:"+a,"\n" +b, "\n" +n);
  }
  
  return (
    <form onSubmit={szamol}>
      <h1 className="test">Mestertétel</h1>
      <div >
      <a className="mesteraa">T értéke (a): </a>
          <input type="text" name="A" className="mesterinput"/>
      </div>
      <br />
      <div >
      <a>n-es tag (b): </a>
          <input type="text" name="B" className="mesterinput"/>
      </div>
      <br />
      <div >
          <a>n : </a>
          <input type="text" name="N" className="mesterinput"/>
          <br />
          <br />
        <div>
          <Button variant="secondary">
            Megold
          </Button>
        </div>
      </div>
    </form>
  );
}

export default Mester;
